import React, { Fragment } from "react"
import Moment from 'moment';
import FileIcon from "./FileIcon";

const Details = props => {
    
    return (
        <Fragment>
            <h3>Details</h3>
            <hr />
            <div className="text-center">
                <h4 className="text-secondary">{props.title}</h4>
                <p className="small fw-light">{Moment(props.uploadDate).format('dddd - DD MMMM yyyy')}</p>
            </div>
            <hr/>
            <div className="text-center">
                <h5>Main file</h5>
                <a className="text-decoration-non" download={props.file}></a>
            </div>
        </Fragment>
    )
}
export default Details;
